import logo from './logo.svg';
import './App.css';
import Login from './component/Login';
import { Link, Routes } from 'react-router-dom';


function App() {
  return (
    <div className="App">
    <Link to="/Login" >Login</Link>
    <MainNavigation/>
    <Routes>
      <Route path="/login" element={ <Login/> } />
    </Routes>
    </div>
  );
}

export default App;
